--
-- Table structure for table `projects`
--

DROP TABLE IF EXISTS `projects`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `projects` (
  `id` int unsigned NOT NULL,
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название проекта',
  `genre_id` int unsigned DEFAULT NULL,
  `release_year` int NOT NULL COMMENT 'Год выпуска',
  `released` tinyint(1) NOT NULL COMMENT 'Публикация проекта на сайте',
  `access_id` int unsigned DEFAULT NULL COMMENT 'Ссылка на доступ',
  `description` text CHARACTER SET utf8 COLLATE utf8_unicode_ci COMMENT 'Описание проекта',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `name_genre_id_idx` (`name`,`genre_id`),
  KEY `projects_genres_id_fk` (`genre_id`),
  KEY `projects_accesses_id_fk` (`access_id`),
  CONSTRAINT `projects_accesses_id_fk` FOREIGN KEY (`access_id`) REFERENCES `accesses` (`id`) ON DELETE SET NULL,
  CONSTRAINT `projects_genres_id_fk` FOREIGN KEY (`genre_id`) REFERENCES `genres` (`id`) ON DELETE RESTRICT
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Проекты';
/*!40101 SET character_set_client = @saved_cs_client */;

